export const navLinks = [
  {
    href: "./vehicles",
    label: "VEHICLE",
  },
  {
    href: "./energy",
    label: "ENERGY",
  },
  {
    href: "./charging",
    label: "CHARGING",
  },
  {
    href: "./discover",
    label: "DISCOVER",
    links: [
      {
        title: "Resources",
        links: [
          { label: "Demo Drive", to: "/" },
          { label: "Customer Stories", to: "/" },
          { label: "Events", to: "/" },
        ],
      },
      {
        title: "Location Services",
        links: [
          { label: "Find Us", to: "/" },
          { label: "Trip Planner", to: "/" },
          { label: "Find a Collision Center", to: "/" },
          { label: "Find a Certified Installer", to: "/" },
        ],
      },
      {
        title: "Company",
        links: [
          { label: "About", to: "/" },
          { label: "Careers", to: "/" },
          { label: "Investor Relations", to: "/" },
        ],
      },
    ],
  },
];
